import React from 'react'

export default function About(props) {
    return (
        <div>
            <header>
                <h1>Welcome to the Community Page!</h1>
                <p>Stay updated on local recycling events, explore articles on sustainability, and join the conversation.</p>
            </header>
        </div>
    );
}
